import React, { useState } from "react";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider
} from "@material-ui/pickers";
import MomentUtils from "@date-io/moment";
import "moment/locale/ru";
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import "../dtpic/dtpic.css"

import Datatab from "../datatab/datatab"

const click = () => {
  console.log('http://localhost:62499/api/zplist/'+document.getElementById('start').value + '-' + document.getElementById('end').value)
}

class Dtpic extends React.Component {
  render(){
    const click=()=>{
      console.log ('Нажал' + document.getElementById("start")+"&" + document.getElementById("end"))
    }
    return (
      <div className="botmarg">
        <Grid container spacing={3}>
          <Grid item xs>
            <div>
              <label htmlFor="start">Start date:</label>
              <input type="date" id="start" name="trip-start" for></input>
              <label htmlFor="start">End date:</label>
              <input type="date" id="end" name="trip-start"></input>
       
       
            </div>
          </Grid>
          <Grid  item xs>
            <Button  onClick={click} variant="contained" color="secondary"  >
              Получить
            </Button>
          </Grid>
          <Grid item xs>
  
          </Grid>
        </Grid>
  
       
  
 
  
        <Datatab api="123123123"/>
      </div>
    );
  }
}

export default Dtpic;
